import { useEffect, useState } from 'react';
import axois from 'axios';
import { Button, Container } from 'react-bootstrap';

function App() {
  const [hello, setHello] = useState('');
  useEffect(() => {
    axois
      .get('/api/hello')
      .then((res) => setHello(res.data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <div className="App">
      <Container>
        Spring : {hello}
        <Button>123</Button>
      </Container>
    </div>
  );
}

export default App;
